import hashlib
import base64




def check_hashes(input_list):
    checks = [
        ('sha1', -1),
        ('md5', 0),
        ('base64', 3),
        ('sha256', 5),
        ('sha384', 4),
        ('sha512', 10),
        ('sha3_256', 6),  # Added sha3_256 check
        ('sha3_384', 12),  # Added sha3_384 check
        ('sha3_512', 11),  # Added sha3_512 check
        ('blake2b', 2),   # Added blake2b check
    ]

    results = []
    for word in input_list:
        counter=0
        for check in checks: 
            if check[0] == 'sha1':
                hash_object = hashlib.sha1(word[check[1]].encode())
                if hash_object.hexdigest() == "da4b9237bacccdf19c0760cab7aec4a8359010b0":
                    counter+=1
                    results.append(word)
                    print(word+"sha1true")
            elif check[0] == 'md5':
                hash_object = hashlib.md5(word[check[1]].encode())
                if hash_object.hexdigest() == "f186217753c37b9b9f958d906208506e":
                    counter+=1
                    results.append(word)
                    print(word+"md5true")
            elif check[0] == 'base64':
                encoded_word = base64.b64encode(word[check[1]].encode()).decode()
